import logo from "./logo.svg";
import "./App.css";
import React from "react";
import { Link } from "react-router-dom";

function App() {
  return (
    <div>
      <h1>Welcome to Visor+</h1>
      <p>Are you a student or a research advisor?</p>
      <div>
        <Link to="/register/student">Student Registration</Link>
      </div>
      <div>
        <Link to="/register/advisor">Advisor Registration</Link>
      </div>
    </div>
  );
}

export default App;
